import React from 'react';
const Fetch = require('node-fetch');

let url = "https://jsonplaceholder.typicode.com/posts";
let settings = { method: "Get" };
let data = Fetch(url, settings)
    .then(res => res.json())
    .then((json) => {


        return json;
    })

.catch(error => { console.log("server is down") });

const response = () => {
    data.then((a) => {
        data = a;
        for (var i in data) {

            console.log(i)
            console.log("------");
            console.log(data[i].id);
            document.getElementById("data").innerHTML = data[i].id;
            console.log("------");
            console.log(data[i].title);
            document.getElementById("data").innerHTML = data[i].title + '<\br>';
            console.log("------");
            console.log(data[i].body);
            document.getElementById("data").innerHTML = data[i].body + '<\br>';
            console.log("_______________________");

        }
        return data;
    });

}
response();
